import * as React from 'react';
import './App.css';

const style = {
  border: '2px solid #000',
  marginTop: '50%',
  left: '50%',
};

const Header = (props) => {

  const handleDiv = () => {
    alert("Este es el header");
  }

  return(
    <div onClick={handleDiv} sx={style}>
        <p>{props.title}</p>
        <p>{props.subTitle}</p>
    </div>
  );
}

export default Header;
